Keygen for JetBrains IntelliJ IDEA 13 Ultimate.

Verified on Linux, Mac OS X and Windows:  &lt;a href=&quot;
http://imgur.com/a/DpLDV&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://imgur.com/a/DpLDV&lt;/a&gt;

I didn't write this; I found it on a forum and tweaked the code a bit to strip out the GUI and make it take a single command-line argument: the user name that's associated with the serial number. If you can't figure out how to run this, you don't need the Ultimate version of IntelliJ.

(Unlike my previous keygen uploads, I guarantee that it's clean. It's a command-line Java program (package-less .class file) with source code. I compiled the source code with javac from Oracle JDK 7u45 on 64-bit Linux. If you want to be sure that )the .class file matches the source code, feel free to recompile it yourself.
